import React from "react"

function List({todos,deleteHandler}) {
  return(
       <div>
      {todos.map((todo,index) => 
          <div key={index}>
              <h5>{todo} &nbsp; <button onClick={deleteHandler(index)}>Delete</button></h5>
         </div>
            )}


  </div>)
}

export default List
